import React, { Component } from "react";

class Header extends Component {
  render() {
    return (
      <header>
        <div>{this.props.header}</div>
        <h1>{this.props.title}</h1>
        <nav>
          <ul>
            <li>TOP</li>
            <li>CONCEPT</li>
            <li>CONTACT</li>
          </ul>
        </nav>
      </header>
    );
  }
}

export default Header;
